@pytest.mark.slow
class TestSubscanEnjinApiCalls(TestCase):
    api = EnjinSubscanApi
    addresses_of_account = ['enDmUBJpyJhth3HMPQXUj7pkzYaUDQuSPf7WeqkKhf2j2rkme',
                            '1EZtbHrToKtVjXy2z63R3E5FCuif5SRDuwsAQE68urBRFvH',
                            ]
    hash_of_transactions = ['0x0ec6dba0a73686caee1235d1e6e34a21338c6fa1ef33e11c3ae86cc31e56c118',
                            '0x31efc2fd06689765d99ded5b12910cdc270997aa4901284103ca049edc1d135e',
                            '0xe142aafb0dd97ebc275630a8d619c87ea99632c71243691b6f002af44f2a70d7',
                            '0xfab3d3609d82cd14ae7ed61f33857ce6d00b3d1494f86df422f8bab38f663a36',
                            '0x23ebd6a7d46a87b2829319dee3a3d10db4c02532e187c7bedcb6733fa7ecef84',
                            '0x492bef57b1c0a15ca5499716034d6302cc3c30fe6e4ea8102dc55fd9037c03ab',
                            '0xb4e2d4e67bc744af0f9ca866e779a0f61dc97046cfc9a0dd9d133154f4bc1aab']

    @staticmethod
    def check_general_response(response, keys):
        if set(response.keys()).issubset(keys):
            return True
        return False

    def test_get_balance_api(self):
        first_layer_keys = {'code', 'message', 'generated_at', 'data'}
        balance_keys = {'address', 'balance', 'lock'}
        for address in self.addresses_of_account:
            get_balance_result = self.api.get_balance(address)
            assert isinstance(get_balance_result, dict)
            assert self.check_general_response(get_balance_result, first_layer_keys)
            assert isinstance(get_balance_result.get('data'), dict)
            assert get_balance_result.get('data').get('account')
            assert isinstance(get_balance_result.get('data').get('account'), dict)
            assert balance_keys.issubset(get_balance_result.get('data').get('account'))
            assert isinstance(get_balance_result.get('data').get('account').get('balance'), str)

    def test_get_address_txs_api(self):
        first_layer_keys = {'code', 'message', 'generated_at', 'data'}
        transfer_keys = {'from', 'to', 'extrinsic_index', 'success', 'hash', 'block_num', 'block_timestamp', 'module',
                         'amount', 'amount_v2', 'usd_amount', 'fee', 'nonce', 'asset_symbol', 'asset_unique_id',
                         'asset_type', 'item_id', 'from_account_display', 'to_account_display', 'event_idx'}
        for address in self.addresses_of_account:
            get_address_txs_response = self.api.get_address_txs(address)
            assert isinstance(get_address_txs_response, dict)
            assert self.check_general_response(get_address_txs_response, first_layer_keys)
            assert isinstance(get_address_txs_response.get('data'), dict)
            if get_address_txs_response.get('data').get('transfers'):
                assert isinstance(get_address_txs_response.get('data').get('transfers'), list)
                for transfer in get_address_txs_response.get('data').get('transfers'):
                    assert transfer_keys.issubset(transfer)

    def test_get_block_head_api(self):
        first_layer_keys = {'code', 'message', 'generated_at', 'data'}
        blockhead_keys = {'activeAccountCount', 'addressType', 'avgBlockTime', 'blockNum', 'blockTime', 'bootTime',
                          'commissionAccuracy', 'count_account', 'count_account_all', 'count_event',
                          'count_signed_extrinsic', 'count_transfer', 'currentPools', 'current_era',
                          'current_validator_count', 'epochLength', 'epochProcess', 'eraLength', 'eraProcess',
                          'exist_roles', 'finalized_blockNum', 'implName', 'maxNominatorRewardedPerValidator',
                          'networkNode', 'specVersion', 'tokenRefreshAt', 'unbondDuration', 'validator_count',
                          'waiting_validator'}
        get_block_head_response = self.api.get_block_head()
        assert isinstance(get_block_head_response, dict)
        assert self.check_general_response(get_block_head_response, first_layer_keys)
        assert isinstance(get_block_head_response.get('data'), dict)
        assert self.check_general_response(get_block_head_response.get('data'), blockhead_keys)
        assert isinstance(get_block_head_response.get('data').get('blockNum'), str)

    def test_get_tx_details_api(self):
        first_layer_keys = {'code', 'message', 'generated_at', 'data'}
        transaction_keys = {'block_timestamp', 'block_num', 'extrinsic_index', 'call_module_function', 'call_module',
                            'account_id', 'signature', 'nonce', 'extrinsic_hash', 'success', 'params', 'transfer',
                            'event', 'event_count', 'fee', 'fee_used', 'error', 'finalized', 'lifetime', 'tip',
                            'account_display', 'block_hash', 'pending', 'multisig', 'sub_calls'}
        event_keys = {'event_index', 'block_num', 'extrinsic_idx', 'module_id', 'event_id', 'params', 'phase',
                      'event_idx', 'extrinsic_hash', 'finalized', 'block_timestamp'}
        for tx_hash in self.hash_of_transactions:
            get_tx_details_response = self.api.get_tx_details(tx_hash)
            assert isinstance(get_tx_details_response, dict)
            assert self.check_general_response(get_tx_details_response, first_layer_keys)
            assert isinstance(get_tx_details_response.get('data'), dict)
            assert self.check_general_response(get_tx_details_response.get('data'), transaction_keys)
            if get_tx_details_response.get('data').get('event'):
                assert isinstance(get_tx_details_response.get('data').get('event'), list)
                for event in get_tx_details_response.get('data').get('event'):
                    assert isinstance(event, dict)
                    assert self.check_general_response(event, event_keys)

    def test_get_block_txs_api(self):
        first_layer_keys = {'code', 'message', 'generated_at', 'data'}
        block_keys = {'block_num', 'block_timestamp', 'hash', 'parent_hash', 'state_root', 'extrinsics_root',
                      'extrinsics', 'events', 'logs', 'event_count', 'extrinsics_count', 'spec_version', 'validator',
                      'finalized', 'account_display'}
        event_keys = {'event_index', 'block_num', 'extrinsic_idx', 'module_id', 'event_id', 'params', 'phase',
                      'event_idx', 'extrinsic_hash', 'finalized', 'block_timestamp'}
        get_block_txs_response = self.api.get_block_txs(1744874)
        assert isinstance(get_block_txs_response, dict)
        assert self.check_general_response(get_block_txs_response, first_layer_keys)
        assert isinstance(get_block_txs_response.get('data'), dict)
        assert self.check_general_response(get_block_txs_response.get('data'), block_keys)
        if get_block_txs_response.get('data').get('event'):
            assert isinstance(get_block_txs_response.get('data').get('event'), list)
            for event in get_block_txs_response.get('data').get('event'):
                assert isinstance(event, dict)
                assert self.check_general_response(event, event_keys)


